description:
The Strat Pack: Live in Concert

A film of a September 24, 2004 concert featuring Joe Walsh, 
Gary Moore, Brian May, David Gilmour, and many 
more, marking the 50th Anniversary of the Fender 
Stratocaster guitar. 

The film was released in 2005.


This is an Xvid, AC3 48000, avi




